import React from "react";

const Contacts = ({ contacts }) => {
  return (
    <ul>
      {contacts.map((contact) => {
        return (
          <li key="name">
            {contact.name} {contact.phone}
          </li>
        );
      })}
    </ul>
  );
};

export default Contacts;
